import React from 'react';
import Logo from '../Images/MIS SERVICES REQUEST (1).png';

const Header = () => {
	return (
		<div className='header'>
			<div className='logo'>
				<h1></h1><img src={Logo} alt='logo' />
			</div>

		</div>
	);
};
export default Header;
